import * as React from "react";

import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";

import DialogTitle from "@mui/material/DialogTitle";
import Dialog from "@mui/material/Dialog";
import {
  Button,
  DialogContent,
  FormGroup,
  Checkbox,
  FormControl,
  FormControlLabel,
  InputLabel,
  Select,
  Grid,
} from "@mui/material";

function YearModal({ open, handleClose, handleSelect, years }) {
  return (
    <Dialog onClose={handleClose} open={open}>
      <DialogTitle>Set backup account</DialogTitle>
      <DialogContent>
        <List sx={{ pt: 0 }}>
          <ListItem disablePadding>
            <FormGroup>
              {years.map((year, index) => {
                console.log("year!", year);
                return (
                  <FormControlLabel
                    key={index}
                    control={<Checkbox defaultChecked={year.selected} />}
                    label={year.year}
                  />
                );
              })}
            </FormGroup>
          </ListItem>
        </List>
      </DialogContent>
      <Grid container spacing={2}>
        <Grid size={{ xs: 6, md: 4 }}>
          <Button
            onClick={() => {
              console.log("hi");
            }}
          >
            Add
          </Button>
        </Grid>
        <Grid size={{ xs: 6, md: 4 }}>
          <Button
            onClick={() => {
              console.log("hi");
            }}
          >
            Cancel
          </Button>
        </Grid>
      </Grid>
    </Dialog>
  );
}

export default YearModal;
